import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      pokemonList: []
    }
  }

  componentDidMount() {
    fetch("https://pokeapi.co/api/v2/pokedex/kanto/")
    .then(result => result.json())
    .then(pokedex => {
        let pokemonList = [];
        let pokemons = pokedex.pokemon_entries;
        pokemons.forEach(pokemon => {
            console.log(pokemon);
            fetch(pokemon.pokemon_species.url)
              .then(res => res.json())
              .then(pokemon => {
                console.log(pokemon.id);
                pokemonList.push(pokemon);
              })
        });

        return pokemonList;
    })
    .then(list => {
      this.setState({
        pokemonList: list
      });
    });
  }

  render() {
    //console.log(this.props.pokemons);
    return (
      <div className="App">
        {this.state.pokemonList[0].id}
      </div>
    );
  }
}

export default App;
